package day14DoWhileLoopOdev;

public class Odev1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		/*
		 * 1)9 den 190 e kadar 7 nin kati olan tüm tamsayıları ekrana yazdırınız.
		 */
		
		
		int num=9;
		
		do {
			if(num%7==0) {
				System.out.println(num);
			}
			
		} while(num<190);
	
	
	     }
	
       
		
	}